class Verisync{config;appId;constructor(i){this.config=i,this.appId=encodeURIComponent(JSON.stringify({redirectUrl:i.redirectUrl,clientId:i.clientId,flowId:i.flowId,meta:i.meta}))}open(){this.appId||console.error(`App ID is ${this.appId}`,this.config),window.open(`https://app.verisync.co/synchroniser/${this.appId}`,"_blank")}}